name = "TRANSLATE-1"
n_states = 2
n_neighbors = 8
def transition_function(a):
    rs = ""
    nw = int(a[0])
    ne = int(a[1])
    sw = int(a[2])
    se = int(a[3])
    nc = int(a[4])
    cw = int(a[5])
    ce = int(a[6])
    sc = int(a[7])
    cc = int(a[8])
    
    index = (nw*(2**0))+(nc*(2**1))+(ne*(2**2))+(cw*(2**3))+(cc*(2**4))+(ce*(2**5))+(sw*(2**6))+(sc*(2**7))+(se*(2**8))
    return int(rs[index])